// utils.js (client)
import "isomorphic-fetch"
import { startTime } from "../pages/index.js";

export function addName(name) {
  const time = startTime;
    return fetch('http://localhost:3001/addtime', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ name, time: time }) // the reason you're getting wacky number is because its counting time down from 1970
    })
}
